// Student.js

import React, { useState } from 'react';
import './Student.css';

function Student() {
  const [studentData, setStudentData] = useState({
    name: '',
    rollNo: '',
    gender: '',
    class: '',
    city: '',
    state: '',
    subject1: '',
    subject2: '',
    subject3: '',
    subject4: '',
    subject5: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setStudentData({ ...studentData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here (e.g., send data to a server or store locally).
    console.log('Student data submitted:', studentData);
  };

  return (
    <div className="student-container">
      <div className="content">
        <h2>Student Details</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Name:</label>
            <input
              type="text"
              name="name"
              value={studentData.name}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Roll No:</label>
            <input
              type="text"
              name="rollNo"
              value={studentData.rollNo}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Gender:</label>
            <input
              type="text"
              name="gender"
              value={studentData.gender}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>Class:</label>
            <input
              type="text"
              name="class"
              value={studentData.class}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>City:</label>
            <input
              type="text"
              name="city"
              value={studentData.city}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>State:</label>
            <input
              type="text"
              name="state"
              value={studentData.state}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>Subject 1:</label>
            <input
              type="text"
              name="subject1"
              value={studentData.subject1}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Subject 2:</label>
            <input
              type="text"
              name="subject2"
              value={studentData.subject2}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Subject 3:</label>
            <input
              type="text"
              name="subject3"
              value={studentData.subject3}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>Subject 4:</label>
            <input
              type="text"
              name="subject4"
              value={studentData.subject4}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>Subject 5:</label>
            <input
              type="text"
              name="subject5"
              value={studentData.subject5}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <button type="submit">Submit</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Student;
